import React from 'react';

import './style/navbar,';
const Navbar=()=>{
    return(
        <nav>
            <li><a href='#'>Home</a></li>
            <li><a href='/contact'>Contact</a></li>
            <li><a href='/about'>About</a></li>
            <li><a href='/login'>Login</a></li>
            <li><a href='/signup'>Register</a></li>    
        </nav>
    );
}

export default Navbar;
